package com.example.day03;

public class Lesson6_While {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		
		
		int i = 0;
		
		do{
			i++;
			
			if(i % 2 ==0) continue;       //컨티뉴는 조건만족시키면 do로 돌아간다
			System.out.println(i);
		
		}while(i < 10) ;
		

		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
	}

}
